description:
After the disastrous events of Amazons Attack, Wonder Girl strikes out to tie up some particularly monstrous loose ends. But with the rift between her and Wonder Woman, she's going to need the help of the last man on Earth she ever wanted to see again! 

Written by J. Torres and pencilled by Sanford Greene.


